    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    overflow-x: hidden;
  }
  section {
    margin: 30px 0;
  }
  .section_text_cont {
    width: 350px;
  }
  .content {
    padding: 0;
  }
  .intro_img {
    display: none;
  }
  .offer_cont {
    width: 350px;
    margin-right: 0px;
    left: 0;
  }
