    justify-content: center;
  }
  .point_section,
  .eco,
  .footer,
  .start_section {
    width: 350px;
    height: auto;
    display: flex;
    flex-direction: column;
  }
  .main_card,
  .start_section {
    display: none;
  }
  .footer_card {
    flex-direction: column;
  }
  .header {
    width: 100vw;
    display: flex;
    align-items: center;
    justify-content: center;
  }
  .copy_header {
    width: 75px;
    height: auto;
  }
  .par,
  .sub_heading {
    width: 300px;
    text-align: left;
  }
  .flex_item {
    display: none;
  }
  .offer button {
    padding: 15px;
  }
