    display: none;
  }
  .eco {
    display: flex;
    flex-direction: column-reverse;
  }
  #my-video {
    width: 250px;
    height: 250px;
    object-fit: cover;
    margin-top: 30px;
  }
  .instruction_cont .section_text_cont,
  .why_section_cont .section_text_cont {
    text-align: left;
    width: 350px;
    left: 0;
  }
  .instr_buttons .secondary_button,
  .instr_buttons .secondary_button {
    padding: 10px 15px;
  }
  .vertical_card {
