  .why_card {
    width: 350px;
  }
  .why_card {
    height: 450px;
  }
  .event {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    width: 20rem;
  }
  .event_section .event_section_heading {
    font-size: 1rem;
    width: 20rem;
    color: var(--font-sec);
  }
  .event_section .section_text_cont p {
    font-size: 1.25rem;
    text-align: center;
  }
  .event_cards_cont {
    display: flex;
    flex-wrap: wrap !important;
    flex-direction: row;
    align-items: center;
    justify-content: center;
    margin: 30px 0;
  }
  .event_section_cont .section_text_cont {
    text-align: center;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
  }
}
@media only screen and (max-width: 400px) {
  .step,
  .why_card {
    width: 325px;
  }
  .why_card {
    height: 475px;
  }
  .section_text_cont,
  .offer_cont,
  .instruction_cont .section_text_cont,
  .why_section_cont .section_text_cont {
    width: 275px;
  }
  .instr_buttons {
    display: flex;
    flex-direction: column;
  }
}
@media only screen and (max-width: 350px) {
  p {
    font-size: 14px;
  }
  .section_text_cont p {
    width: 250px;
  }
  .footer {
    width: 300px;
  }
  .sub_card {
    width: 300px;
  }
  .footer .section_text_cont .sub_heading {
    font-size: 14px;
  }
  .step,
  .why_card {
    width: 300px;
  }
  .why_card {
    height: 500px;
  }
  .why_card .par {
    width: 250px;
    font-size: 14px;
    line-height: 25px;
  }
  .section_text_cont,
  .offer_cont,
  .instruction_cont .section_text_cont,
  .why_section_cont .section_text_cont {
    width: 250px;
  }
  .instr_buttons .secondary_button {
    margin: 10px;
  }
  .event {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    width: 15rem;
  }
  .event_section .event_section_heading {
    font-size: 1rem;
    width: 15rem;
    color: var(--font-sec);
  }
  .event_section .section_text_cont p {
    font-size: 1rem;
    text-align: center;
  }
  .button-group .primary_button {
    border: 1px solid rgba(255, 255, 255);
    width: 10rem;
    font-size: 0.5rem;
    font-weight: bolder;
  }
}

.timeline {
  overflow-x: hidden;
  white-space: nowrap;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}
.timeline ol {
  font-size: 0;
  width: 100%;
  padding: 250px 0;
  transition: all 1s;
}

.timeline ol li {
  position: relative;
  display: inline-block;
  list-style-type: none;
  width: 160px;
  height: 3px;
  background: #fff;
}
.timeline ol li:first-child {
  width: 0;
}
.timeline ol li:last-child {
  width: 280px;
}

.timeline ol li:not(:first-child) {
  margin-left: 14px;
}

.timeline ol li:not(:last-child)::after {
  content: "";
  position: absolute;
  top: 50%;
  left: calc(100% + 1px);
  bottom: 0;
  width: 12px;
  height: 12px;
  transform: translateY(-50%);
  border-radius: 50%;
  background: var(--component_pri);
}

.timeline ol li div {
  position: absolute;
  left: calc(100% + 7px);
  width: 280px;
  padding: 15px;
  font-size: 1rem;
  white-space: normal;
  color: black;
  background: white;
}

.timeline ol li div::before {
  content: "";
  position: absolute;
  top: 100%;
  left: 0;
  width: 0;
  height: 0;
  border-style: solid;
}

.timeline ol li:nth-child(odd) div {
  top: -16px;
  transform: translateY(-100%);
  border-radius: 5px;
  border-bottom-left-radius: 0;
}

.timeline ol li:nth-child(odd) div::before {
  top: 100%;
  border-width: 8px 8px 0 0;
  border-color: white transparent transparent transparent;
}

.timeline ol li:nth-child(even) div {
  top: calc(100% + 16px);
  border-radius: 5px;
  border-top-left-radius: 0;
}

.timeline ol li:nth-child(even) div::before {
  top: -8px;
  border-width: 8px 0 0 8px;
  border-color: transparent transparent transparent white;
}

.timeline time {
  display: block;
  font-size: 1.2rem;
  font-weight: bold;
  margin-bottom: 8px;
}

/* GENERAL MEDIA QUERIES
 */
@media screen and (max-width: 599px) {
  .timeline ol,
  .timeline ol li {
    width: auto;
  }

  .timeline ol {
    padding: 0;
    transform: none !important;
  }

  .timeline ol li {
    display: block;
    height: auto;
    background: transparent;
  }

  .timeline ol li:first-child {
    margin-top: 25px;
  }

  .timeline ol li:not(:first-child) {
    margin-left: auto;
  }

  .timeline ol li div {
    width: 94%;
    height: auto !important;
    margin: 0 auto 25px;
  }

  .timeline ol li div {
    position: static;
  }

  .timeline ol li:nth-child(odd) div {
    transform: none;
  }

  .timeline ol li:nth-child(odd) div::before,
  .timeline ol li:nth-child(even) div::before {
    left: 50%;
    top: 100%;
    transform: translateX(-50%);
    border: none;
    border-left: 1px solid white;
    height: 25px;
  }

  .timeline ol li:last-child,
  .timeline ol li:nth-last-child(2) div::before,
  .timeline ol li:not(:last-child)::after,
  .timeline .arrows {
    display: none;
  }
}
.copyright {
  height: 50px;
  background: var(--component_pri);
  color: var(--font-color);
  padding: 50px 25px;
  width: 100vw;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  text-align: center;
  margin-bottom: -100%;
